window.bookSummaryJSON = "<p>Twisted, unhinged, insane—all words used to describe Gage Presley by those closest to him. A pretty boy with a face that misleads you. He’s one of the deadliest members of The Family.</p> <p>Five years ago, his possessiveness and insane jealousy over a girl unleashed his crazy and in the wake of his retaliation, he was given the choice: prison or the United States Marines.</p> <p>The girl who owned his soul turned her back on him and left town without a goodbye. Shiloh Ellis became a name he never mentioned again.</p> <p>When she walks back into Gage’s life, no one in The Family is happy about it, especially Gage. It’s clear they all loathe her, but she has no memory of them at all....</p>"; 
